} fn system_memory_info_get(index: u8) -> Option<SystemMemoryInfo> Gets information about the regions of memory in the system. An OS can use this to work out where it can store the heap, and load any applications to. Regions should be ordered according to their relative performance, with the fastest region listed first. The fastest regions will be used for the most commonly used data structures (e.g. the system stack). Regions labelled as InstructionTightlyCoupled will ony be used for code (e.g code loaded from disk) and not for data (e.g. variables). Neotron OS has no support for memory refresh. If this is required, it must be arranged by the BIOS in the background.

