enum SerialType { /// An RS-232 interface, but at TTL voltages. Typically used with an /// FTDI FT232 cable. TtlUart, /// An RS-232 interface Rs232, /// A USB Device implementing Communications Class Device (also known as /// a USB Serial port). The USB Device implementation may be on-chip /// (handled by the BIOS), or off-chip. UsbCdc, /// A MIDI interface Midi, /// A Commodore Serial interface Cbm, /// An RS-485 bus Rs485,
} struct SerialInfo { name: ApiStrRef, type: SerialType,
} fn serial_get_info(device_idx: u8) -> Option<SerialInfo>; Get information about the Serial ports in the system. Serial ports are ordered octet-oriented pipes. You can push octets into them using a 'write' call, and pull bytes out of them using a 'read' call. They have options which allow them to be configured at different speeds, or with different transmission settings (parity bits, stop bits, etc) - you set these with a call to SerialConfigure. They may physically be a MIDI interface, an RS-232 port or a USB-Serial port. There is no sense of 'open' or 'close' - that is an Operating System level design feature. These APIs just reflect the raw hardware, in a similar manner to the registers exposed by a memory-mapped UART peripheral.

