Performing a read on the console device will block the application until either the Enter key is pressed on the keyboard, or Control + C is pressed on the keyboard. If the Enter key is pressed, the UTF-8 encoding of the characters entered by the user are copied to the given buffer (up to as many as will fit). If too many characters are entered to fit in to the given buffer, the Console will beep and the user must use Backspace to remove some characters and free up some buffer space. Characters being entered are echoed to the console (although Conceal mode will help if the user is entering a password). In the background during this function, the OS is polling the keyboard for key events, handling special keys (like Backspace, or Shift) and when a valid key is pressed, the matching Unicode character is UTF-8 encoded and added to the buffer. On some Neotron systems, pressing the 'Up' arrow key will restore the previous command line contents (like when using the readline library on GNU/UNIX systems). use neotron::fs::File;
let mut buffer = [0u8; 16];
/// The standard Neotron file read functions can be used to read from the console.
let mut console = File::open("CON$:") .expect("Failed to open console for reading");
match console.read(&mut buffer) { Ok(0) => { println!("You entered an empty string"); } Ok(n) => { // The Neotron OS guarantees this will be valid UTF-8 let read_string = unsafe { core::str::from_utf8_unchecked(&buffer[0..n]) }; println!("You entered {:?}", read_string); } Err(e) => { eprintln!("Oh, I got read error {:?} reading from the console", e); }
}
/// There is also a Neotron Application Library helper function which reads to a buffer (unlike the normal Rust Standard Library function which reads to a `String`).
let bytes_read = neotron::io::stdin() .read_line(&mut buffer) .expect("Failed to read from console");
